Question:Build a Java module that calculates the area of a triangle given the base and the altura. Use if-else to handle the case where the altura is 0.

Solution:```java
public class Calculadora {
    public static void main(String[] args) {
        double base = 5;
        double altura = 3;
        System.out.println("El area del triangulo es: " + calculaArea(base, altura));
    }

    private static double calculaArea(double base, double altura) {
        if (altura == 0){
            return 0;
        }else{
            return base * altura / 2;
        }
    }
}
