Question:Build a Python module snippet that calculates the sum of the first 100 multiples of 3 or 5. Use a for loop and the modulo operator. No classes, no external libraries, no recursion.
Solution:```python
def suma3():
    suma = 0
    for i in range(1, 101):
        if i % 3 == 0 or i % 5 == 0:
            suma += i
    return suma
